import React, {Component} from 'react';
import {withStyles} from '@material-ui/core/styles';
import {FusePageSimple, DemoContent} from '@fuse';
import Scheduler, { Resource } from 'devextreme-react/scheduler';

import { employees, data } from './data.js';
import DataCell from './DataCell.js';
import ResourceCell from './ResourceCell.js';

const styles = theme => ({
    layoutRoot: {}
});

const currentDate = new Date(2016, 7, 2, 11, 30);
const groups = ['employeeID'];
const views = ['month'];

class Example extends Component {

    render()
    {
        const {classes} = this.props;
        return (
            <FusePageSimple
                classes={{
                    root: classes.layoutRoot
                }}
                header={
                    <div className="p-24"><h4>Header</h4></div>
                }
                contentToolbar={
                    <div className="px-24"><h4>Content Toolbar</h4></div>
                }
                content={
                    <div className="p-24">
                        <h4>Content</h4>
                        <br/>
                        <Scheduler
                            dataSource={data}
                            dataCellComponent={DataCell}
                            resourceCellComponent={ResourceCell}
                            groups={groups}
                            views={views}
                            defaultCurrentView={'month'}
                            defaultCurrentDate={currentDate}
                            height={600}
                            showAllDayPanel={true}
                            firstDayOfWeek={1}
                            startDayHour={8}
                            endDayHour={18}
                        >
                            <Resource
                            label={'Employee'}
                            fieldExpr={'employeeID'}
                            dataSource={employees}
                            allowMultiple={false}
                            />
                        </Scheduler>
                    </div>
                }
            />
        )
    }
}

export default withStyles(styles, {withTheme: true})(Example);
